import React, {useState} from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from 'react-router-dom';

const Section = ({path, title, content}) => {
  const[status, setStatus] = useState(false)

  return (
    <Link to={path} className="section" dir="rtl" done={status}>
      <h1 className="section-title">
        <span>{title}</span>
        <div className="done" onClick={
          (e) => {
            e.stopPropagation();
            setStatus(true)
          }
        }></div>
      </h1>
      <p className="section-contant">{content}</p>
    </Link>
  );
}

export default Section;
